import React from "react";

const About = () => {
  return (
    <>
      <div className="ab_main">
        <div className="ab_blocks">
          <div className="ab_img"></div>
          <div className="ab_profile"></div>
        </div>
        <div className="ab_blocks">
          <div className="ab_activity"></div>
          <div className="ab_work_details">
            <div></div>
            <div></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default About;
